.macro gameOverScreen
    # $s0 = bitmap base (dst)
    la    $t1, gameOverScreen_sprite      # src pointer
    move  $t2, $s0          # dst pointer
    li    $t3, 16384      # pixels remaining

gameOverScreen_loop:
    slti  $t0, $t3, 8   # $t0=1 if remaining < unroll
    bnez  $t0, gameOverScreen_rem
    nop
    lw    $t0, 0($t1)
    sw    $t0, 0($t2)
    lw    $t4, 4($t1)
    sw    $t4, 4($t2)
    lw    $t5, 8($t1)
