    lw    $t9, 24($t1)
    sw    $t9, 24($t2)
    lw    $t0, 28($t1)
    sw    $t0, 28($t2)
    addiu $t1, $t1, 32
    addiu $t2, $t2, 32
    addiu $t3, $t3, -8
    b     gameOverScreen_loop
    nop

gameOverScreen_rem:
    beqz  $t3, gameOverScreen_done
    nop
gameOverScreen_rem_loop:
    lw    $t4, 0($t1)
    sw    $t4, 0($t2)
    addiu $t1, $t1, 4
    addiu $t2, $t2, 4
    addiu $t3, $t3, -1
    bnez  $t3, gameOverScreen_rem_loop
    nop

